--
-- Name: assign_cluster(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.assign_cluster() RETURNS void
    LANGUAGE plpgsql
    AS $$
DECLARE
    rec record;
    new_geom geometry;
    temp_rec record;
    rec_exists boolean;
BEGIN
    FOR rec IN SELECT * FROM working_linestrings WHERE joined = false LOOP
            new_geom := rec.geom;
            rec_exists := exists(SELECT 1 FROM working_linestrings
                        WHERE ST_Touches(new_geom, working_linestrings.geom)
                          AND ST_GeometryType(ST_LineMerge(ST_Union(new_geom, working_linestrings.geom))) = 'ST_LineString'
                          AND working_linestrings.joined = false
                          AND rec.id <> working_linestrings.id);
            WHILE rec_exists LOOP
                SELECT * into temp_rec FROM working_linestrings
                        WHERE ST_Touches(new_geom, working_linestrings.geom)
                          AND ST_GeometryType(ST_LineMerge(ST_Union(new_geom, working_linestrings.geom))) = 'ST_LineString'
                          AND working_linestrings.joined = false
                          AND rec.id <> working_linestrings.id limit 1;
                new_geom := (ST_LineMerge(ST_Union(new_geom, temp_rec.geom)));
                DELETE FROM working_linestrings where id = temp_rec.id and joined = false;
                rec_exists := exists(SELECT 1 FROM working_linestrings
                        WHERE ST_Touches(new_geom, working_linestrings.geom)
                          AND ST_GeometryType(ST_LineMerge(ST_Union(new_geom, working_linestrings.geom))) = 'ST_LineString'
                          AND working_linestrings.joined = false
                          AND rec.id <> working_linestrings.id);
            end loop;
            UPDATE working_linestrings set geom = new_geom, joined = true where id = rec.id;
    END LOOP;
END;
$$;


