--
-- Name: process_all_roads(); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.process_all_roads() RETURNS void
    LANGUAGE plpgsql
    AS $$
    DECLARE
    rec record;
    BEGIN
        FOR rec in SELECT distinct name from roads LOOP
            perform process_road(rec.name);
            end loop;
select roads.id, segments.id from segments inner join roads on segments.road_name = roads.name ON CONFLICT DO NOTHING;
    END;
    $$;


ALTER FUNCTION public.process_all_roads() OWNER TO postgres;

--
-- Name: process_road(character varying); Type: FUNCTION; Schema: public; Owner: postgres
--

CREATE FUNCTION public.process_road(roadname character varying) RETURNS void
    LANGUAGE plpgsql
    AS $$
BEGIN
    DROP TABLE IF EXISTS working_linestrings;
    CREATE TEMP TABLE working_linestrings AS
    SELECT id, geom, false AS joined
    FROM roads WHERE name = roadName;

    PERFORM assign_cluster();

    CREATE SEQUENCE temp_sequence AS INTEGER MINVALUE 0;

    SELECT roadName, nextval('temp_sequence'), geom from (
        SELECT (ST_dump(ST_Split(ml.geom, p.geom))).geom as geom
        FROM
            (SELECT geom FROM working_linestrings) AS ml inner join
            (SELECT ST_Collect(geom) AS geom FROM intersections) AS p on st_intersects(ml.geom, p.geom)
     ) A;
    DROP SEQUENCE temp_sequence;
END;
$$;


